import { motion } from 'framer-motion';

export const header = {
    init: {
        backgroundColor: 'rgba(83, 83, 83, .0)'
    },
    after: {
        backgroundColor: 'rgba(83, 83, 83, .15)',
        transition: {
            delay: 2,
            duration: 1.25,
            when: "beforeChildren"
        }
    }
}

export const name = {
    iti
}

export const leterOne = {
    init: {
        opacity: 0
    },
    after: {
        opacity: 1,
        transition: {
            delay: .2,
            duration: 1.25
        }
    }
}

export const leterTwo = {
    init: {
        opacity: 0
    },
    after: {
        opacity: 1,
        transition: {
            delay: .3,
            duration: 1.25
        }
    }
}

export const leterThree = {
    init: {
        opacity: 0
    },
    after: {
        opacity: 1,
        transition: {
            delay: .4,
            duration: 1.25
        }
    }
}
